import React, { useState, useEffect } from "react";
import Swal from 'sweetalert2';
import { FaPlus, FaTimes } from 'react-icons/fa';
import ProyectoForm from "./ProyectoForm";
import ProyectoEdit from "./ProyectoEdit";
import ProyectoCard from "./ProyectoCard"; // Nuevo componente para la tarjeta de proyecto

const Main = () => {
  const [proyectos, setProyectos] = useState([]);
  const [mostrarFormulario, setMostrarFormulario] = useState(false);
  const [proyectoEditar, setProyectoEditar] = useState(null);

  useEffect(() => {
    getAllProject();
  }, );

  const getAllProject = async () => {
    try {
      const response = await fetch("http://localhost:3000/projects/");
      if (response.ok) {
        const data = await response.json();
        setProyectos(data);
      } else {
        throw new Error("Error al obtener los proyectos: " + response.statusText);
      }
    } catch (error) {
      console.error("Error al comunicarse con el servidor:", error);
      mostrarError("Hubo un problema al cargar los proyectos. Por favor, intenta nuevamente más tarde.");
    }
  };

  const handleCrearProyecto = () => {
    setProyectoEditar(null);
    setMostrarFormulario(true);
  };

  const handleEditarProyecto = (proyecto) => {
    setProyectoEditar(proyecto);
    setMostrarFormulario(true);
  };

  const handleEliminarProyecto = async (proyectoId) => {
    const confirmacion = await mostrarConfirmacion(
      '¿Estás seguro?',
      'Esta acción eliminará el proyecto permanentemente.'
    );

    if (confirmacion.isConfirmed) {
      try {
        const response = await fetch(`http://localhost:3000/projects/${proyectoId}`, {
          method: "DELETE"
        });
        if (response.ok) {
          mostrarExito("Proyecto eliminado exitosamente.");
          getAllProject();
        } else {
          throw new Error("Error al eliminar el proyecto: " + response.statusText);
        }
      } catch (error) {
        console.error("Error al comunicarse con el servidor:", error);
        mostrarError("Hubo un problema al eliminar el proyecto. Por favor, intenta nuevamente más tarde.");
      }
    }
  };

  const handleActualizarProyectos = () => {
    getAllProject();
  };

  const handleCloseFormulario = () => {
    setMostrarFormulario(false);
  };

  const mostrarConfirmacion = async (titulo, texto) => {
    return await Swal.fire({
      title: titulo,
      text: texto,
      icon: 'warning',
      showCancelButton: true,
      confirmButtonColor: '#3085d6',
      cancelButtonColor: '#d33',
      confirmButtonText: 'Sí, eliminar',
      cancelButtonText: 'Cancelar'
    });
  };

  const mostrarExito = (mensaje) => {
    Swal.fire({
      title: 'Éxito',
      text: mensaje,
      icon: 'success',
      confirmButtonText: 'Aceptar'
    });
  };

  const mostrarError = (mensaje) => {
    Swal.fire({
      title: 'Error',
      text: mensaje,
      icon: 'error',
      confirmButtonText: 'Aceptar'
    });
  };

  return (
    <>
      {mostrarFormulario && (
        <div className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-50">
          <div className="bg-gray-100 w-96 p-4 rounded-lg shadow-lg relative z-50">
            <button
              onClick={handleCloseFormulario}
              className="absolute top-2 right-2 text-gray-500 hover:text-gray-700 focus:outline-none"
              >
              <FaTimes />
            </button>
            <div className="form-container">
              {proyectoEditar ? (
                <ProyectoEdit
                proyectoInicial={proyectoEditar}
                onSubmit={handleCloseFormulario}
                onProjectUpdate={handleActualizarProyectos}
                />
              ) : (

                <ProyectoForm
                  onSubmit={handleCloseFormulario}
                  onProjectUpdate={handleActualizarProyectos}
                />
              )}
            </div>
          </div>
        </div>
      )}

      <div className="max-w-4xl mx-auto p-6 mt-8"> {/* Cambiado a mt-8 */}
        <header className="flex justify-between items-center mb-8">
          <h2 className="text-3xl font-bold text-gray-800">Projects</h2>
          <button
            onClick={handleCrearProyecto}
            className="flex items-center px-4 py-2 bg-blue-600 text-white font-semibold rounded-lg shadow-md transition duration-300 hover:bg-blue-700 hover:scale-105 focus:outline-none"
          >
            <FaPlus className="mr-2" /> New Project
          </button>
        </header>

        <div className="grid grid-cols-3 gap-6">
          {proyectos.map((proyecto) => (
            <ProyectoCard
              key={proyecto.id}
              proyecto={proyecto}
              onEditar={handleEditarProyecto}
              onEliminar={handleEliminarProyecto}
            />
          ))}
        </div>
      </div>
    </>
  );
};

export default Main;
